import React from "react";
import { Route, Routes } from "react-router-dom";
import TittlePage from "./pages/TittlePage";
import "./style/App.css";

function App() {
  return (
    <Routes>
      <Route path="/" element={<TittlePage />} />
    </Routes>
  );
}

export default App;
